import React from 'react';

const RegistrationPage = () => {
  const containerStyle = {
    display: 'flex',
    flexDirection: 'column',  // Stack rectangles vertically
    alignItems: 'center',
    minHeight: '100vh',  // Use the full height of the viewport
    overflowY: 'auto',  // Allow vertical scrolling if needed
  };

  const mainRectangleStyle = {
    width: '80%',  // Adjusted width to make it adaptable
    flexShrink: 0,
    backgroundColor: '#1962B9',
    display: 'flex',
    flexDirection: 'column',  // Stack rectangles vertically
    padding: '2rem',
    boxSizing: 'border-box',
  };

  const innerRectangleStyle = {
    width: '100%',  // Adjusted width to make it adaptable
    flexShrink: 0,
    borderRadius: '1.25rem',
    backgroundColor: '#E9F3FF',
    margin: '12px 0',  // Add margin between rectangles
  };

  return (
    <div style={containerStyle}>
      <div style={mainRectangleStyle}>
        <div style={innerRectangleStyle}>
          Rectangle 1
        </div>
        <div style={innerRectangleStyle}>
          Rectangle 2
        </div>
        <div style={innerRectangleStyle}>
          Rectangle 3
        </div>
      </div>
    </div>
  );
};

export default RegistrationPage;
